insert into endgame (id,name,type,version,size,rating,hot,language,count,updateDate,comment,description,icon,thumbnails,url,fullname,initialname) values ('262','牛郎哥我来啦','益智游戏','1.0','278K','5','100','中文','86910',1408077036031,'牛郎找妹子，妹子找牛郎！','牛郎织女是汉族四大民间爱情传说之一。相关节日为七夕节。农历七月七日夜晚，仰望群星闪烁的夜空，人们能看到银河两岸有着两颗遥遥相对的亮星。织女、牛郎星，《七夕鹊桥会》传说就是讲的他们之间的爱情故事。相传织女是王母的女儿，她心灵手巧，善织，能用一双灵巧的手织出五彩缤纷的云朵。人间有个孤儿叫牛郎，他虽然勤劳，但一直过着贫苦的生活。后来，牛郎在老牛的指点下，取走了在湖中洗澡的织女的衣裳，织女也喜爱牛郎，两人就结成了夫妻。从此，男耕女织，生下一儿一女，过上了幸福美满的生活。谁知织女下凡在人间与牛郎尽享天伦之乐，荒废了布耘织霞，王母知道后，大发雷霆，派天兵将织女捉回天宫。牛郎在老牛的帮助下，用箩筐装着儿女，挑着追到天上。王母见牛郎追来，就用头上的金钗在织女和牛郎之间划出一道大河，这就是银河。滔滔的银河水无情地把牛郎和织女隔在两岸，他们只得隔河痛哭相望。后来王母见他们哭得伤心，动了恻隐之心，命喜鹊传话让他们每隔七日相见一次。谁知喜鹊传错了话，说成每年七月七日相见一次。于是王母就罚喜鹊给他们搭桥。每年七月七日晚上，牛郎织女就在喜鹊搭成的桥上相会，倾诉衷肠。传说这天晚上，到了夜深人静的时候，在葡萄架下能听到牛郎和织女的窃窃细语，天上要是落下雨点，那就是他俩伤心的泪水。左、右、左、右，切克有！还有跳！','http://i2.wanh5.com/item/1408/02/53dc785cc65d5_s.png','http://i2.wanh5.com/item/1408/01/53db4d5aeba2a_b.jpg,http://i4.wanh5.com/item/1408/01/53db4d5b0455b_b.jpg,http://i5.wanh5.com/item/1408/01/53db4d5b1063b_b.jpg,http://i4.wanh5.com/item/1408/01/53db4d5b1ce0d_b.jpg','http://g.wanh5.com/sc/queqiao/','niulanggewolaila','nlgwll');
