insert into endgame (id,name,type,version,size,rating,hot,language,count,updateDate,comment,description,icon,thumbnails,url,fullname,initialname) values ('261','偶吧刚弄死他','敏捷游戏','1.0','214K','5','100','中文','87091',1408077036031,'秀恩爱死得快！快来帮她使使坏！','恩爱守恒定律“：恩爱既不会凭空产生，也不凭空消失，它只能从正房转化给小三，或者从一个备胎转移到另一个备胎，在转化或转移的过程中，恩爱的总量不变。这就是恩爱守恒定律，这也解释了为什么“秀恩爱，死得快”。无论是“攻”还是“受”，无论是攻“公”还是“母”！就一句话！只要拉手就弄死它们！','http://i4.wanh5.com/item/1408/02/53dc5c3293b0f_s.jpg','http://i5.wanh5.com/item/1408/01/53db452a6f0f3_b.jpg,http://i5.wanh5.com/item/1408/01/53db452a80283_b.jpg,http://i2.wanh5.com/item/1408/01/53db452a919aa_b.jpg,http://i2.wanh5.com/item/1408/01/53db452aa20ae_b.jpg','http://g.wanh5.com/sc/ou8/','oubagangnongsita','obgnst');
