insert into endgame (id,name,type,version,size,rating,hot,language,count,updateDate,comment,description,icon,thumbnails,url,fullname,initialname) values ('259','撸一把(小心手机)','动作游戏','1.0','28K','5','100','中文','96508',1408077036031,'疯狂的摇起来','点开始，疯狂的摇手机。小心别摔了哦。微信发到朋友圈，比比谁更能摇。点开始，疯狂的摇手机。小心别摔了哦。微信发到朋友圈，比比谁更能摇。','http://i3.wanh5.com/item/1407/31/53da63074017f_s.gif','http://i4.wanh5.com/item/1407/31/53da6360231f9_b.png,http://i1.wanh5.com/item/1407/31/53da6360309de_b.png','http://g.wanh5.com/sc/yao','luyiba(xiaoxinshouji)','lyb(xxsj)');
