insert into endgame (id,name,type,version,size,rating,hot,language,count,updateDate,comment,description,icon,thumbnails,url,fullname,initialname) values ('258','今天我们都老了吗？','益智游戏','1.0','81K','5','100','中文','64041',1408077036031,'考验你“么么哒”年龄的观察力和记忆力吧！','进入到感觉器官的各种刺激停止后，感觉并不立即消失，而会在一个极短的时间内保存下来，这种保留瞬间的记忆就叫瞬时记忆，也叫感觉记忆。如，视觉后象就属于瞬时记忆。瞬时记忆的特点：瞬时记忆的编码方式，即瞬时记忆记住的方式，是外界刺激物的形象。所以具有鲜明的形象性。瞬时记忆的容量很大，但保留的时间很短。容量为9－20比特，时间4秒以内。图象记忆0.25－1秒，声象记忆可以超过1秒，不会长于4秒。如果对瞬时记忆中的加以注意，或者说当意识到瞬时记忆的时，就被转入短时记忆了，否则，没有注意到的过1秒钟便会消失，也就是遗忘了。瞬间记忆能力强人反应敏捷，判断迅速。这个游戏测试的是瞬时记忆能力。在数字瞬间闪现时记下位置，然后按从小到大的顺序点击，游戏结果大脑年龄越小则反映瞬间记忆能力越强。','http://i2.wanh5.com/item/1407/31/53da03c029b44_s.jpg','http://i3.wanh5.com/item/1407/31/53da03d7ab7bb_b.jpg,http://i1.wanh5.com/item/1407/31/53da03d7b4d40_b.jpg,http://i2.wanh5.com/item/1407/31/53da03d7bcc10_b.jpg,http://i5.wanh5.com/item/1407/31/53da03d7c4db4_b.jpg','http://g.wanh5.com/sc/diy/howold','jintianwomendulaoliaoma？','jtwmdllm？');
