insert into endgame (id,name,type,version,size,rating,hot,language,count,updateDate,comment,description,icon,thumbnails,url,fullname,initialname) values ('255','围住““陌陌”鱼','策略闯关','1.0','94K','5','100','中文','9633',1408077036031,'围住那只“陌陌”鱼，最重要的就是填满它周围六个点。','一夜之间，突然又出现了一款爆红的小游戏——围住““陌陌”鱼！目前访问量已经达到“蛇精病”的程度啦!这是一款经典耐玩的游戏了，这款游戏突在朋友圈疯传!小乖为大家分享游戏地址，赶紧来玩一玩吧!定理1：如果你在“陌陌”鱼边上2格之内布子，除非有很好的地形，不然“陌陌”鱼必定从你身边跑掉。所以在开阔场地，你的棋子至少和“陌陌”鱼中间隔2个空格。定理2：当你在开阔场地布下第一子时，封锁线会形成于你的这个子和“陌陌”鱼中线的靠你那一侧。你应当让盘上已有子力和你的新子位于这条线上。定理3：“陌陌”鱼是“聪明”的，所以你的布子方位要挡在“陌陌”鱼的前方。','http://i4.wanh5.com/item/1407/31/53d9f2cebdadd_s.jpg','http://i3.wanh5.com/item/1407/31/53d9f5b190079_b.jpg,http://i3.wanh5.com/item/1407/31/53d9f5b1984d2_b.jpg,http://i1.wanh5.com/item/1407/31/53d9f5b19fd6e_b.jpg,http://i3.wanh5.com/item/1407/31/53d9f5b1a7209_b.jpg','http://g.wanh5.com/sc/diy/fish/','weizhu““momo”yu','wz““mm”y');
