insert into endgame (id,name,type,version,size,rating,hot,language,count,updateDate,comment,description,icon,thumbnails,url,fullname,initialname) values ('112','头脑风暴（数独）','儿童教育','1.0','52K','2','40','中文','25344',1408077036033,'把空格填满！','数独，是一种源自18世纪末的瑞士，后在美国发展、并在日本得以发扬光大的数字谜题。利用逻辑和推理，在其他的空格上填入1-9的数字。使1-9每个数字在每一行、每一列和每一宫中都只出现一次。这种游戏全面考验做题者观察能力和推理能力，虽然玩法简单，但数字排列方式却千变万化，所以不少教育者认为数独是训练头脑的绝佳方式。玩家需要根据9×9盘面上的已知数字，推理出所有剩余空格的数字，并满足每一行、每一列、每一个粗线宫内的数字均含1-9，不重复。','http://i4.wanh5.com/item/1406/18/53a1921566b53_s.png','http://i4.wanh5.com/item/1406/16/539ee0daca395_b.jpg,http://i2.wanh5.com/item/1406/16/539ee0dad5b38_b.jpg,http://i2.wanh5.com/item/1406/16/539ee0dadefad_b.jpg','http://g.wanh5.com/p1/shudu_two/','tounaofengbao（shudu）','tnfb（sd）');
